import React from 'react';
import './App.css';
import Navbar from './components/Navbar/index1';
import {BrowserRouter as Router  } from "react-router-dom";
import Internship from './Internship';
import Footer from './components/Footer/index';



function App(){const myList = ['Undergraduate', 'Post Graduate', 'Doctoral', 'Post Doctoral', 'Other'];   
const listItems = myList.map((myList)=>{   
    return <li>{myList}</li>;  

}); 


return (<Router>

    <Navbar />
    <div id="a">

    <div id ="list1">
    <h3>Filter_By:</h3>
     <h3>Level_of_Study</h3>  
    <ul > {listItems} </ul> 
    <h3>Award_Type</h3> 
    <ul>
        <li>Schloarship</li>
        <li>Fellowship</li>
        <li>Grant</li>
        <li>Prize</li>
        <li>Public Grant</li>
    </ul>
    <h3>Where_To_Live</h3> 
    <ul>
        <li>India</li>
        <li>Assam</li>
        <li>Delhi</li>
        <li>Uttar Pradesh</li>

    </ul>
    <h3>International</h3> 
    <ul>
        <li>US</li>
        <li>France</li>
        <li>Califonia</li>
        <li>Alaska</li>
        <li>Ohio</li>
    </ul>
    </div>
    <Internship />
    </div>
    <Footer/>

</Router>

);
}
export default App;
